<style>html {
  -ms-touch-action: none;
}

body, canvas, div {
  display: block;
  outline: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);

  user-select: none;
  -moz-user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -khtml-user-select: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

/* Remove spin of input type number */
input::-webkit-outer-spin-button,
input::-webkit-inner-spin-button {
    /* display: none; <- Crashes Chrome on hover */
    -webkit-appearance: none;
    margin: 0; /* <-- Apparently some margin are still there even though it's hidden */
}

body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;
  border: 0;
  margin: 0;

  cursor: default;
  color: #888;
  background-color: #333;

  text-align: center;
  font-family: Helvetica, Verdana, Arial, sans-serif;

  display: flex;
  flex-direction: column;
}

canvas {
  background-color: rgba(0, 0, 0, 0);
}

#GameDiv, #Cocos3dGameContainer, #GameCanvas {
  width: 100%;
  height: 100%;
}

:root {
  --safe-top: env(safe-area-inset-top);
  --safe-right: env(safe-area-inset-right);
  --safe-bottom: env(safe-area-inset-bottom);
  --safe-left: env(safe-area-inset-left);
}
</style></head>

          transparent 0, transparent 28px), linear-gradient(90deg, #f04000, #f8e200);
    }

    .loader_c {
      position: absolute;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      background: radial-gradient(ellipse, #7004b7 5%, #100915 87%);
      z-index: 20;
    }

    .container {
      position: absolute;
      left: 50%;
      width: 50%;
      top: 45%;
      height: 40%;
      max-height: 80vh;
      transform: translate(-50%, -50%);
      background: var(--logo-image) top center/auto 50% no-repeat;
      background-size: contain;
    }

    .progress-bar {
      position: absolute;
      bottom: -6%;
      width: 150%;
      box-sizing: border-box;
      border: solid 0.1em #230835;
      height: 0.8em;
      left: 50%;
      transform: translate(-50%, -50%);
      border-radius: 0.4em;
      background: linear-gradient(180deg, #28083c, #4a0775);
      font: clamp(0.625em, 10vw, 8em) monospace;
      box-shadow: 0 0 0.3em 0.05em #b71bff,
        inset 0 0 0.015em 0.01em #afa4b4;
    }

    .progress-bar::-webkit-progress-bar {
      background: transparent;
    }

    .progress-bar::-webkit-progress-value {
      border-radius: 0.35em;
      box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);
      background: var(--fill);
    }

    .progress-bar::-moz-progress-bar {
      border-radius: 0.35em;
      box-shadow: inset 0 0.1em 0.1em rgba(255, 255, 255, 0.45);
      background: var(--fill);
    }

    .l-text {
      position: absolute;
      display: flex;
      justify-content: center;
      top: 105%;
      width: 100%;
      transform: scaleY(0.85);
      font-family: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande", "Lucida Sans", Arial, sans-serif;
      color: #fff;
      font-size: 5vw;
      font-weight: 600;
      text-align: center;
      letter-spacing: 0.5px;
    }

    .dots {
      letter-spacing: 0;
      margin-left: 3px;
    }

    .dots>span {
      display: inline-block;
      width: 1vw;
      height: 0.55vh;
      opacity: 0;
      background: #fff;
      border-radius: 50%;
      animation: blink 1.5s infinite backwards;
      animation-fill-mode: both;
    }

    .dots>span:nth-child(2) {
      animation-delay: .2s;
    }

    .dots>span:nth-child(3) {
      animation-delay: .4s;
    }

    @media (orientation: landscape) {
      .container {
        top: 40%;
        height: 50%;
        background: var(--logo-image) top center/auto 40% no-repeat;
      }

      .l-text {
        font-size: 5vh;
        top: 110%;
      }

      .dots>span {
        width: 1vh;
        height: 0.55vw;
      }

      .progress-bar {
        bottom: -15%;
        width: 85%;
        font: clamp(0.625em, 6.5vw, 3em) monospace;
      }
    }

    @keyframes blink {
      0% {
        opacity: 1
      }

      99% {
        opacity: 0
      }

      100% {
        opacity: 0
      }
    }
  </style>
